import Pairs from './PairsComponents/Pairs'


function App(){
  const [buttonPopup, setButtonPopup] = useState(false);

    return (
      <div className="App">
        <button onClick={() => setButtonPopup(true)}>Start</button> 
        <Splash trigger={buttonPopup} setTrigger={setButtonPopup}>     
        <h1>Extinction</h1>
        <Map/>
        <Pairs/>
        </Splash>
      </div>

    );
  }


export default App;
